import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
height: 100%;
display: flex;
flex-direction: column;
`;

const Title = styled.h1`
    font-size: 54px;  
    margin-top: 60px;
`;
    
const List = styled.ul`
    
`;

const ListItem = styled.li`
    
`;


const Price = () => {
  return (
    <Container>
        <Title>Pricing</Title>
        <List>
            <ListItem></ListItem>
        </List>
    </Container>
  )
}

export default Price
